import React from "react";
import { useDispatch } from "react-redux";

export default function Filters(genres, games) {
  return (
    <div>
      <select>
        {genres.length
          ? genres.map((g) => {
              return <option key={g.id}>{g.name}</option>;
            })
          : null}
      </select>
      <select>
        <option value="api">Api results</option>
        <option value="db">Db results</option>
      </select>
    </div>
  );
}
